//#region react
import React from 'react';
//#endregion

//#region mui
import Grid from '@mui/material/Grid';
import Radio from '@mui/material/Radio';
import FormControlLabel from '@mui/material/FormControlLabel';
//#endregion

function TokenRadioButton(props) {
    const { values, username } = props;

    function RadioButton(value) {
        if (value.buyerName === username) {
            return (
                <Grid item xs={5} sm={6} md={2.9} key={value.houseAddress}>
                    <FormControlLabel value="female" control={<Radio />} label="Female" />
                </Grid>
            )
        }
    }
    //#region 렌더링
    return (
        <Grid>
            {values.map((value) => (
                console.log(value)
            ))}
        </Grid>)
    //#endregion
}

export default TokenRadioButton;
